import { Fragment } from 'react';
import { useSelector } from 'react-redux';
import Router from 'next/router';
import Header from '../components/Header';
import RedBackdrop from '../components/RedBackdrop';

const Features = () => {
	return (
		<React.Fragment>
			<span>
				<Header />
				<RedBackdrop />
			</span>
			<div>Features</div>
		</React.Fragment>
	);
};

export default Features;
